import React, { createContext } from "react";
import CompA from "./CompA";

const First = createContext();
const LastName = createContext();

const App =() =>{
    return(
        <>
        <First.Provider value={"Asad Rehman"}>
            <LastName.Provider value={" s/o Zafar Ali"}>
                <CompA />

            </LastName.Provider>
            
        </First.Provider>
            
        </>
    )

}

export default App;
export {First, LastName};
